import { Dialog, DialogContent, DialogActions, DialogContentText, DialogTitle, Button, makeStyles } from "@material-ui/core";

const useStyles = makeStyles({
    root: {
        margin: "20px",
    },
    title: {
        fontWeight: 500,
        fontSize: "18px",
        marginBottom: 10,
        marginTop: 0,
    },
    text: {
        fontSize: "14px",
        lineHeight: "20px",
        fontWeight: 400,
        marginTop: 0,
    },

});

export default function DetailDialog(props) {
    const { open, onClose, } = props;
    const classes = useStyles();

    const Transition = React.forwardRef(function Transition(props, ref) {
        return <Slide direction="up" ref={ref} {...props} />;
    });

    return (
        <Dialog
            fullScreen
            className={classes.root}
            onClose={onClose} aria-labelledby="simple-dialog-title" open={open}
            TransitionComponent={Transition}
        >
            <DialogTitle id="alert-dialog-title">User Information</DialogTitle>
            <DialogContent className={classes.content}>
                <DialogContentText id="alert-dialog-description">

                    Google, even when no apps are running.
                </DialogContentText>
            </DialogContent>
            <DialogActions>
                <Button autoFocus onClick={onClose} color="primary">
                    Cancel
                </Button>

            </DialogActions>
        </Dialog>

    )
}
